import {NgModule} from '@angular/core';
import {BrowserModule} from '@angular/platform-browser';

import {AppRoutingModule} from './app-routing.module';
import {AppComponent} from './app.component';
import {HomeComponent} from './home/home.component';
import {HomeAdminComponent} from './admin/home-admin/home-admin.component';
import {HttpClientModule} from "@angular/common/http";
import {ReactiveFormsModule} from "@angular/forms";
import {NgxPaginationModule} from "ngx-pagination";
import { VipAccountComponent } from './admin/vip-account/vip-account.component';
import { NormalAccountComponent } from './admin/normal-account/normal-account.component';
import { BlockAccountComponent } from './admin/block-account/block-account.component';

@NgModule({
    declarations: [
        AppComponent,
        HomeComponent,
        HomeAdminComponent,
        VipAccountComponent,
        NormalAccountComponent,
        BlockAccountComponent,
    ],
    imports: [
        BrowserModule,
        AppRoutingModule,
        HttpClientModule,
        ReactiveFormsModule,
        NgxPaginationModule,
    ],
    providers: [],
    bootstrap: [AppComponent]
})
export class AppModule {
}
